import './App.css';
import Detail from './Detail';
import {Navbar , NavbarBrand} from 'reactstrap'
import 'bootstrap/dist/css/bootstrap.css';



function App() {
  return (    
    <div className = "App">
      <Router>
      <Route path = "/" >
      <Navibar/>
      </Route>
      {/* <Route path = "/detail">
